import React from 'react';


import '../App.css';

const TrustedBy=()=> {

  return (
        <div className="trusted" id="trusted">
            <h2>Trusted By</h2>
            <div className="trusted-images">
                <img src="https://pbs.twimg.com/profile_images/1152687491541024768/VvIKmBSw_400x400.jpg" alt="trusted"/>
                <img src="https://bitrazzi.com/wp-content/uploads/2018/03/ethereum-750x430.jpg" alt="trusted"/>
                <img src="https://miro.medium.com/max/2256/1*oVotVJoRY5DGKGJq8haS1g.png" alt="trusted"/>
                <img src="https://images.typeform.com/images/CwwJzesteZRA/image/default" alt="trusted"/>
            </div>
            <div className="trusted-images">
                <img src="https://pbs.twimg.com/profile_images/1220823227284492288/LsF_g2Y__400x400.png" alt="trusted"/>
                <img src="https://pbs.twimg.com/profile_images/1158001647379013632/qNhXMran.jpg" alt="trusted"/>
                <img src="https://cdn.dribbble.com/users/5459640/screenshots/12127936/media/868468b8ed95efb29b7915cf08e6c10f.jpg" alt="trusted"/>
                <img src="https://coursera-university-assets.s3.amazonaws.com/be/8d0fd0717811e8a81211a9d9c57bc6/ConsenSysAcademy-Logo-Stacked-onWhite-Square.png" alt="trusted"/>

            </div>



        </div>
  );
}

export default TrustedBy;
